import React, { useState, useEffect } from 'react';
import UserTable from "../components/UserTable.js";
import JumbotronTemplate from '../components/JumbotronTemplate';

function View2() {
    const [data, setData] = useState([]);

    const pageHeaderItems = {
        "TopWords": "View 1",
        "BottomWords": "Enter your name to receive a greeting"
    }

    useEffect(() => {
        fetch("/view2").then(
            res => res.json()
        ).then(
            data => {
                setData(data)
            }
        )
    }, [])

    return (
        <div>
            <h1>This is the View 2 page</h1>
            <h3>These are the users that have been entered:</h3>
            <UserTable names={data} />
        </div>
    )
}

export default View2;
